import React from 'react';
import styled from '@emotion/styled';

 const FooterWrapper = styled.div`
 position: relative;
 bottom: 0;
 background: #1d1d1d;
 height: 20vh;

 `

function Footer(props) {
    return(
        <FooterWrapper>
            <h1>Hei</h1>
        </FooterWrapper>
    )
}

export default Footer
